(function(){
	'use strict';

	angular
		.module('site')
		.service('soundService', [soundService]);

	function soundService(){
		var self = this;

		self.error = new Audio("data:audio/mp3;base64,");
		self.success = new Audio("data:audio/wav;base64,");
		self.notify = new Audio("data:audio/mp3;base64,");
		self.stage = new Audio("data:audio/wav;base64,");

		self.play = function(type){
			switch(type){
				case 'error':
					self.error.play();
				break;
				case 'notify':
					self.notify.play();
				break;
				case 'success':
					self.success.play();
				break;
				case 'stage':
					self.stage.play();
				break;
			}
			
		}	
	}
})()